import Card from "../components/Card";
import styles from "./Home.module.css";

import airplaneImg from "../assets/airplane_img.jpg";
import busImg from "../assets/bus_img.jpg";
import carImg from "../assets/car_img.jpg";
import hotelImg from "../assets/hotel_img.jpg";

const Home = () => {
  return (
    <div className={styles}>
      <h1>Welcome to my travel app!</h1>
      <p>
        Find information about bus routes, airlines, rent-a-cars and hotels -
        all at the same place!
      </p>
      <div className={styles.wrapper}>
        <Card
          img={airplaneImg}
          alt="Airplane"
          title="Airlines"
          description="Find your perfect airline"
          route="/airlines"
        />
        <Card
          img={busImg}
          alt="Bus"
          title="Bus lines"
          description="Find your perfect bus line"
          route="/buses"
        />
        <Card
          img={hotelImg}
          alt="Hotel"
          title="Hotels"
          description="Find the best hotels on your destination"
          route="/hotels"
        />
        <Card
          img={carImg}
          alt="Car"
          title="Rent-a-car"
          description="Pick your favorite car for travel"
          route="/rentals"
        />
      </div>
    </div>
  );
};

export default Home;
